var elements=document.getElementsByClassName("cake-core-postLink");var postLinkFunction=function(b){var a=this.getAttribute("data-cake-core-form");var c=this.getAttribute("data-cake-core-confirm");if(c!==null&&c!=="undefined"){if(confirm(c)){document[a].submit();return false}else{return true}}document[a].submit();b.returnValue=false;return false};for(var i=0;i<elements.length;i++){var element=elements[i];element.onclick=postLinkFunction};